import AboutBox from "../components/AboutBox";
import Navbar from "../components/Navbar";


const handleClick = () =>{
    alert("You are getting logged out!");

}


export default function Home(){
    return (
        <div className="Home">
            <Navbar></Navbar>
            <AboutBox ></AboutBox>
            <a href="#" onClick={handleClick}>LOGOUT</a>
        </div>
    )
}
